const Search = ({onSubmit, value, handleChange}) => {
	return (
	<form onSubmit={onSubmit}>
		<input
			type="text"
			name="search"
			value={value}
			placeholder="Search Activities"
			onChange={onChange}
		/>
	<button type="submit">Submit</button>
	</form>
	);
};

export default Search;
